import React from 'react';
import Layout from '../../layout/Layout/Layout';
import styles from './ViewApp.module.scss';
const ViewApp = () =>{
    return(
        <Layout className={styles.screen}>
            <h2>Màn hình ứng dụng G-STORE</h2>
            <p>Ứng dụng G-STORE với giao diện dễ sử dụng, mượt mà đồng thời kết hợp với những tính năng vượt trội mang lại trải nghiệm </p>
        </Layout>
    )
}

export default ViewApp;
